<template>
  <div :id="id" style="width: 100%; height: 100%"></div>

</template>

<script>
import {
  onMounted,
  inject,
  watch,
  reactive,
  toRefs,
  nextTick,
  onUpdated,
} from "vue";
import { v4 as uuid } from "uuid";
import no_data from "@/assets/no_data.png";

export default {
  name: "LineBar",
  props: {
    resOption: Object,
    resData: Object,
  },
  setup(props) {
    const echarts = inject("echarts");

    const data = reactive({
      id: uuid(),
      x: [],
      bar: [],
      line: [],
      no_data: no_data,
      echartsInit: async () => {
        let myChart = echarts.init(document.getElementById(data.id));
        let resOption = props.resOption;
        let option = {
          // 初始化配置
          textStyle: {
            fontFamily: "PingFang SC",
            color: "#8D9EAE",
          },
          grid: {
            left: (resOption.grid && resOption.grid.left) || "16.6%",
            right: (resOption.grid && resOption.grid.right) || "1%",
            top: (resOption.grid && resOption.grid.top) || "48", //resOption.title.subtext ?  '22.6%': '16.4%' ,
            bottom: (resOption.grid && resOption.grid.bottom) || "25%",
          },
          title: {
            text: "",
            padding: [6, 0, 0, 0],
            show: false,
            textStyle: {
              fontSize: 16,
              color: "#515459",
              fontWeight: "700",
            },
            subtext: "", //副标题
            subtextStyle: {
              //副标题文本样式
              color: "#8D9EAE",
              fontSize: 12,
              rich: {
                a: {
                  color: "#F99D35",
                  fontSize: 16,
                },
              },
            },
            itemGap: 0,
          },
          tooltip: {
            trigger: "axis",
            confine: "true",
            axisPointer: {
              type: "shadow",
            },
            formatter: function (params) {
              let str = ""; //声明一个变量用来存储数据
              //str += params[0].name + '</br>';
              //图显示的数据较多时需要循环数据，这样才可以成功的给多条数据添加单位
              for (let i = 0; i < params.length; i++) {
                if (i === 0) {
                  str +=
                    params[i].marker +
                    params[i].seriesName +
                    ": " +
                    params[i].data +
                    resOption.unit[0] +
                    "</br>";
                } else {
                  str +=
                    params[i].marker +
                      params[i].seriesName +
                      ": " +
                      params[i].data !=
                    null
                      ? params[i].data
                      : "--" + resOption.unit[1] + "</br>";
                }
              }
              return str;
            },
          },
          label: {
            show: true,
            position: "top",
            color: "rgba(141, 158, 174, 1)",
          },
          legend: {
            data: resOption.legend.data || ["", ""],
            show: true,
            left: "left",
            itemHeight: 7, //修改icon图形大小
            textStyle: {
              fontSize: 12, //字体大小
              color: "#8D9EAE",
            },
            padding: [1, 0, 0, 2], //可
          },
          /*dataZoom:  [//给x轴设置滚动条
            {
              type: 'slider',
              show: false,
              xAxisIndex: [0],
              handleSize: 0,//滑动条的 左右2个滑动条的大小
              start: 0,//默认为1
              end: 100,  //100-1500/31,//默认为100
              height: 1,
              left: 20,
              right: 40,
              bottom: '13%',
              fillerColor:'#dedede',
              borderColor: "transparent",
              backgroundColor: 'white',//两边未选中的滑动条区域的颜色
              showDataShadow: false,//是否显示数据阴影 默认auto
              showDetail: false,//即拖拽时候是否显示详细数值信息 默认true
            },
            {
              type: 'inside',
              show: true,
              xAxisIndex: [0],
              start: 0,//默认为1
              end: 100-1500/31,//默认为100
            }

          ],*/
          xAxis: [
            {
              type: "category",
              padding: [2, 6, 0, 0],
              splitLine: {
                show: false, //去掉网格线
              },
              axisTick: {
                show: false, //隐藏刻度线
              },
              axisLine: {
                // show: data.x && data.x.length > 0,
                lineStyle: {
                  type: "solid",
                  color: "#E9EFF3", //坐标线的颜色
                  width: "1", //坐标线的宽度
                },
              },
              show: data.x && data.x.length > 0,
              axisPointer: {
                type: "shadow",
              },
              axisLabel: {
                interval: 0,
                rotate:
                  (resOption.xAxis && resOption.xAxis[0].axisLabel.rotate) ||
                  45,
                margin: 8,

                axisName: {
                  fontSize: 9, //字体大小
                },
                formatter: (value) => {
                  let ret = ""; //拼接加\n返回的类目项
                  let maxLength = 10; //每项显示文字个数
                  let valLength = value.length; //X轴类目项的文字个数
                  let rowN = Math.ceil(valLength / maxLength); //类目项需要换行的行数
                  if (rowN > 1) {
                    //如果类目项的文字大于5,
                    for (let i = 0; i < rowN; i++) {
                      let temp = ""; //每次截取的字符串
                      let start = i * maxLength; //开始截取的位置
                      let end = start + maxLength; //结束截取的位置
                      //这里也可以加一个是否是最后一行的判断，但是不加也没有影响，那就不加吧
                      temp = value.substring(start, end) + "\n";
                      ret += temp; //凭借最终的字符串
                    }
                    return ret;
                  } else {
                    return value;
                  }
                },
              },
              data: data.x || [],
            },
          ],
          yAxis: [
            {
              type: "value",
              name: resOption.yAxis[0].name || "",
              nameTextStyle: {
                padding: [0, 41, 0, 0],
              },
              position: "left",
              alignTicks: true,
              axisLabel: {
                interval: 0,
                axisName: {
                  fontSize: 9, //字体大小
                },
              },
            },
          ],
          graphic: [
            {
              type: "text", // 类型：文本
              left: "center",
              top: "75%",
              silent: true, // 不响应事件
              invisible: data.x && data.x.length > 0, // 有数据就隐藏
              style: {
                fill: "#9d9d9d",
                // fontWeight: '700',
                text: "暂无数据",
                fontSize: "14px",
              },
            },
            {
              type: "image", // 类型：图片
              left: "center",
              top: "13%",
              silent: true, // 不响应事件
              invisible: data.x && data.x.length > 0, // 有数据就隐藏
              style: {
                width: "180",
                fill: "#9d9d9d",
                image:
                  "data:image/png;base64,",
              },
            },
          ],
          series: [
            {
              name: (resOption.series && resOption.series[0].name) || "",
              type: "bar",
              barWidth:
                (resOption.series && resOption.series[0].barWidth) || 10, //柱状条宽度
              itemStyle: {
                color:
                  (resOption.series && resOption.series[0].itemStyle.color) ||
                  "#76A0F8", //柱状条的颜色
                borderRadius: [5, 5, 0, 0], //设置柱状条的边框圆角
              },

              data: data.bar || [],
            },
            {
              name: (resOption.series && resOption.series[1].name) || "",
              type: "line",
              itemStyle: {
                color:
                  (resOption.series && resOption.series[1].itemStyle.color) ||
                  "#76A0F8", //折线的颜色
                borderRadius: [5, 5, 0, 0], //设置折线的边框圆角
              },
              symbol: "none", //取消折点圆圈
              smooth: false, //设置曲率
              data: data.line || [],
            },
          ],
        };

        // 绘制图表
        await myChart.setOption(option);
        // await myChart.resize();

        window.onresize = function () {
          //自适应大小
          myChart.resize();
        };
      },
    });
    onUpdated(() => {});
    onMounted(() => {
      //需要获取到element,所以是onMounted的Hook
      /*nextTick(()=>{
        data.echartsInit()
      })*/
    });
    watch(
      () => ({ ...props.resData }),
      async (res, o) => {
        await Promise.all([
          (data.x = res.x),
          (data.bar = res.bar1),
          (data.line = res.line1),
        ]);

        await data.echartsInit();
      },
      { immediate: true, deep: true }
    );
    return {
      ...toRefs(data),
    };
  },
};
</script>


